import "./NameList.css";

const NameList = (props) => {
  const name = props.dataList[0].age;

  return (
    <div>
      {props.dataList.map((item) => (
        <div>
          (item.name + " - " + item.age)
        </div>
      ))}
    </div>

  );
} 

export default NameList;
